        <div>
            <div>
                <span>{pai.nome}</span>
                <span>{pai.idade}</span>
                <span>{pai.nerd?'Verdadeiro':'Falso'}!</span>
            </div>
            <IndiretaFilho quandoClicar={ fornecerInformacoes } />
        </div>
    )

}
